import {Link} from "react-router-dom";
import MovieIcon from '@mui/icons-material/Movie';
import PageviewIcon from '@mui/icons-material/Pageview';
import {Background, LeftMenu} from "./styles";

const AppLayout = ({ children }) => {
  return (
    <Background>
      <LeftMenu>
        <h1>Mucvies</h1>
        <ul>
          <li>
            <Link to="/boxoffice">
              <MovieIcon />
              박스오피스
            </Link>
          </li>
          <li>
            <Link to="/search">
              <PageviewIcon />
              영화 검색
            </Link>
          </li>
        </ul>
      </LeftMenu>
      <div>
        {children}
      </div>
    </Background>
  );
};

export default AppLayout;
